module.exports = Backbone.View.extend({
  el: 'body',

  initialize: function () {
    _.bindAll(this, 'render');
    this.$el.data({view: this});
  },

  render: function () {
    var project = localstorage.project;
    if (project) {
      this.project = Application.loadProject(project);
    } else {
      
    }
  }
});